"""Http Server for OAuth."""
import logging
import http.server
from socketserver import ThreadingMixIn
import threading

logger = logging.getLogger(__name__)

TEMPLATE = """
<!doctype html>
<html lang="en">
<head>
    <meta http-equiv="refresh" content="10;url=https://crosscloud.io/" />
    <meta charset="utf-8">
    <title>Crosscloud</title>
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="icon" type="image/png" sizes="16x16" href="https://crosscloud.io/assets/favicons/favicon-16x16.png">
    <link href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css" rel="stylesheet" type="text/css" media="all"/>
    <link rel="stylesheet" href="http://crosscloud.io/assets/main.min.css?v=170822073641">
</head>

<body>
        <div class="main-container">
            <section class="fullscreen">
                <div class="container v-align-transform mb80">
                  <div class="row">
                    <a href="https://crosscloud.io">
                    <img alt="Embedded Image", class="img-responsive center-block", alt="Cross Cloud" width="50%", src="data:image/jpeg;base64," />
                  </div>
                    <div class="row">
                        <div class="col-sm-10 col-sm-offset-1">
                            <div class="text-center mt80", style="color:#1174FF">
                                <h1>{h1}</h1>
                                <h1>{h2}</h1>
                            </div>
                        </div>
                    </div>
                  </div>
            </section>
        </div>
      </body>
</html>
"""

class OAuthCallback(http.server.BaseHTTPRequestHandler):
    """HTTP Handler used as oauth callback."""

    def render(self, heading, message):
        """Output the oauth_response.html with the heading and message inserted.

        :param heading: The main heading for the returned page.
        :param message: Extra information for the user
        :type heading: str
        :type message: str
        """

        self.headers['Content-Type'] = 'text/html'
        self.send_response(200)
        self.end_headers()
        self.flush_headers()
        response = TEMPLATE.format(h1=heading, h2=message)
        self.wfile.write(response.encode('UTF-8'))

        self.wfile.flush()

    def do_GET(self):
        """Wait until check_function returns true then shuts down the http server."""

        _, url, _ = self.requestline.split()
        if 'favicon' in url:
            # Browsers might request a favicon. We do not want to return one.
            # and we do not want to set it as the server result so we simply return.
            return

        if self.server.check_function(url):
            self.server.result = url
            self.render(heading='Authentication was successful.',
                        message='It is now safe to close this window.')
        else:
            self.render(heading='Authentication has failed. Please try again later.',
                        message='It is now safe to close this window.')

        self.server.done()

    def log_message(self, format_, *args):
        logger.info(format_, *args)


class OAuthHTTPServer(ThreadingMixIn, http.server.HTTPServer):
    """Small webserver used as OAUTH callback server."""
    allow_reuse_address = True

    def __init__(self, check_function):
        super().__init__(('localhost', 9324), OAuthCallback)
        self.check_function = check_function
        self.done_event = threading.Event()
        self.result = None

    def done(self):
        """Called after get has been processed."""
        self.done_event.set()
